const Home = () => {
    return(
        <div className='w-5/6 border-r border-stone-400'>
            <div className=' border-b border-stone-400 border-spacing-6 mt-4 text-lg '>
                <div className='mt-5 ml-4'>
                    <h1 className='font-semibold text-3xl'>Página inicial</h1>
                    <p className='mt-4 text-lg'>Veja as atualizações de quem você está seguindo</p>
                </div>
            </div>
        </div>
    )
}

export default Home;
